sys_variable_value.value:
(function execute(inputs, outputs) {

  const webhook = JSON.parse(inputs.response_body).find(h => h.config.url == inputs.callback_url);
  if (webhook) {
    outputs.webhook_id = webhook.id;
  }

})(inputs, outputs);

